//새로운 값을 받는 컴포넌트?

import React from "react";
import ExpenseForm from "./ExpenseForm";
import './NewExpense.css';

const NewExpense = () => {
    return (
    <div className="new-expense">
        <ExpenseForm onSaveExpenseSate/>
    </div>
    );//여기에 onSaveExpenseSate라고 porp을 하나 만들어줌
};
export default NewExpense;
